import { Link } from 'react-router-dom'; 

class Navbar extends Component {
    state = {  }
    render() { 
        return ( 
            <div>
                <h2>Hello from Navbar</h2>
                <Link to='/'>Home</Link>
                <Link to='/cart'>Cart</Link>
                <Link to='/details'>Product</Link>
            </div>

         );
    }
}

export default Navbar;
